import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import logo from "../assets/logo.png";
import "../Layout.css";

function Navbar() {
  const [menuOpen, setMenuOpen] = useState(false); // Hamburger meny
  const [rulesOpen, setRulesOpen] = useState(false); // Regler dropdown (mobil)
  const [contactOpen, setContactOpen] = useState(false); // Kontakt dropdown (mobil)

  const toggleMenu = () => setMenuOpen(!menuOpen);
  const toggleRules = () => setRulesOpen(!rulesOpen);
  const toggleContact = () => setContactOpen(!contactOpen);

  return (
    <nav className="navbar">
      <div className="navbar-left">
        <img src={logo} alt="Kumla Sportfiske" className="logo" />
      </div>

      <button className="hamburger" onClick={toggleMenu}>
        ☰
      </button>

      <div className={`navbar-right ${menuOpen ? "active" : ""}`}>
        <NavLink to="/" className="navlink" onClick={() => setMenuOpen(false)}>Startsida</NavLink>

        {/* Regler Dropdown */}
        <div className="dropdown">
          <span
            className="navlink"
            onClick={() => window.innerWidth <= 768 && toggleRules()}
          >
            Regler ▼
          </span>
          <div
            className="dropdown-content"
            style={{ display: window.innerWidth > 768 || rulesOpen ? "block" : "none" }}
          >
            <NavLink to="/rules?lake=Lugnet" onClick={() => setMenuOpen(false)}>Lugnet</NavLink>
            <NavLink to="/rules?lake=Säbylundssjön" onClick={() => setMenuOpen(false)}>Säbylundssjön</NavLink>
            <NavLink to="/rules?lake=Nolsjön" onClick={() => setMenuOpen(false)}>Nolsjön</NavLink>
            <hr style={{ margin: "5px 0", borderColor: "#0077cc" }} />
            <NavLink to="/clubrules" onClick={() => setMenuOpen(false)}>Klubbregler</NavLink>
          </div>
        </div>

        {/* Kontakt Dropdown */}
        <div className="dropdown">
          <span
            className="navlink"
            onClick={() => window.innerWidth <= 768 && toggleContact()}
          >
            Kontakt ▼
          </span>
          <div
            className="dropdown-content"
            style={{ display: window.innerWidth > 768 || contactOpen ? "block" : "none" }}
          >
            <NavLink to="/contact" onClick={() => setMenuOpen(false)}>Allmän kontakt</NavLink>
            <NavLink to="/inspectors" onClick={() => setMenuOpen(false)}>Tillsynsmän</NavLink>
            <NavLink to="/about" onClick={() => setMenuOpen(false)}>Om oss</NavLink>
          </div>
        </div>

        {/* Övriga länkar */}
        <NavLink to="/news" className="navlink" onClick={() => setMenuOpen(false)}>Nyheter</NavLink>
        <NavLink to="/gallery" className="navlink" onClick={() => setMenuOpen(false)}>Galleri</NavLink>
        <a
          href="https://www.ifiske.se/fiske-sabylundssjon.htm"
          target="_blank"
          rel="noopener noreferrer"
          className="navlink"
          onClick={() => setMenuOpen(false)}
        >
          iFiske
        </a>
      </div>
    </nav>
  );
}

export default Navbar;
